import { Box, Heading, Text } from '@primer/react';

export function CodeSnippet() {
  return (
    <Box
      sx={{
        border: '1px solid',
        borderColor: 'border.default',
        borderRadius: 2,
        alignSelf: 'flex-start',
        width: '100%',
        maxWidth: '600px',
      }}
    >
      <Box
        sx={{
          borderBottom: '1px solid',
          borderColor: 'border.default',
          p: 3,
        }}
      >
        Get label
      </Box>
      <Box
        sx={{
          borderBottom: '1px solid',
          borderColor: 'border.default',
          pt: 2,
          px: 3,
        }}
      >
        Sub nav
      </Box>
      <Box sx={{ bg: 'canvas.subtle' }}>Code</Box>
    </Box>
  );
}
